--
-- TOC entry 233 (class 1259 OID 16530)
-- Name: personaddressreportview; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.personaddressreportview AS
 SELECT p.salutation,
    p.title,
    p.first_name AS "firstName",
    p.last_name AS "lastName",
    string_agg((pt.name)::text, ', '::text) AS "persType",
    pa.address AS "privateAddress",
    pc.zip AS "privateZip",
    pc.city AS "privateCity",
    pcountry.country AS "privateCountry",
    o.name AS "orgName",
    string_agg((ot.name)::text, ', '::text) AS "orgType",
    oa.address AS "orgAddress",
    oc.zip AS "orgZip",
    oc.city AS "orgCity",
    ocountry.country AS "orgCountry"
   FROM ((((((((((((public.person p
     LEFT JOIN public.orgcontactperson USING (person_id))
     FULL JOIN public.organisation o ON (((orgcontactperson.organisation_id = o.organisation_id) AND (o.active = 1))))
     LEFT JOIN public.relorgtype relorgtype(type_id, organisation_id_1) ON ((relorgtype.organisation_id_1 = o.organisation_id)))
     LEFT JOIN public.type ot ON ((ot.type_id = relorgtype.type_id)))
     LEFT JOIN public.relpersontype ON ((p.person_id = relpersontype.person_id)))
     LEFT JOIN public.type pt ON ((pt.type_id = relpersontype.type_id)))
     LEFT JOIN public.address pa ON ((p.address_id = pa.address_id)))
     LEFT JOIN public.address oa ON ((o.address_id = oa.address_id)))
     LEFT JOIN public.city pc ON ((p.city_id = pc.city_id)))
     LEFT JOIN public.city oc ON ((o.city_id = oc.city_id)))
     LEFT JOIN public.country pcountry ON ((p.country_id = pcountry.country_id)))
     LEFT JOIN public.country ocountry ON ((o.country_id = ocountry.country_id)))
  WHERE ((COALESCE(p.active, 1) = 1) AND (COALESCE(o.active, 1) = 1))
  GROUP BY p.salutation, p.title, p.first_name, p.last_name, pa.address, pc.zip, pc.city, pcountry.country, o.name, oa.address, oc.zip, oc.city, ocountry.country
  ORDER BY p.last_name;


--
-- TOC entry 234 (class 1259 OID 16535)
-- Name: personemailreportview; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.personemailreportview AS
 SELECT p.person_id AS personid,
    p.salutation,
    p.title,
    p.last_name AS lastname,
    p.first_name AS firstname,
    p.comment,
    string_agg((pt.name)::text, ', '::text) AS perstype,
    email.email,
    t.name AS emailtype,
    o.name AS organisationname
   FROM ((((((public.person p
     LEFT JOIN public.relpersontype USING (person_id))
     LEFT JOIN public.type pt ON ((relpersontype.type_id = pt.type_id)))
     LEFT JOIN public.email USING (person_id))
     LEFT JOIN public.type t ON ((email.type_id = t.type_id)))
     LEFT JOIN public.orgcontactperson USING (person_id))
     LEFT JOIN public.organisation o USING (organisation_id))
  WHERE (p.active = 1)
  GROUP BY p.person_id, p.salutation, p.title, p.last_name, p.first_name, p.comment, email.email, t.name, o.name
  ORDER BY p.last_name;


